import React, { useState } from "react";
//import { Navbar, NavbarBrand, Nav, NavDropdown } from "react-bootstrap";
import { AppBar, Toolbar, Button, Typography, Menu, MenuItem } from "@material-ui/core";

function HeadBar() {
  const [about, setAbout] = useState(null);

  const aboutClick = (e) => {
    setAbout(e.currentTarget);
  };

  const aboutClose = () => {
    setAbout(null);
  };

  return (
    <AppBar position="static">
      <Typography style={{fontFamily:"cursive", fontSize:"40px", fontStyle:"italic", marginLeft:"20px", marginTop:"10px"}}>Math Is Cool</Typography>
      <Toolbar>
        <Button color="inherit" href="/">Home</Button>
        <div>
          <Button color="inherit" onClick={aboutClick}>About Us</Button>
          <Menu>
            <MenuItem href="/about/history">History</MenuItem>
            <MenuItem href="/about/contacts">Contacts</MenuItem>
            <MenuItem href="/about/locations">Locations</MenuItem>
          </Menu>
        </div>
        <Button color="inherit" href="/information/fees">Information</Button>
        <Button color="inherit" href="/resources/rules">Resources</Button>
        <Button color="inherit" href="/competitions">Competitions</Button>
        <Button color="inherit" href="/login">Login</Button>
      </Toolbar>
    </AppBar>
  );
}

export default HeadBar;
